import React from 'react';

const EventsContainer = (props)=>{

    const eventList = props.eventList.map((event, i)=>{
        return (
            <li key={i}>
                {event} 
            </li> 
        )
    })
    return(
        <div className="events-dump">
            <h1>These are the Upcoming Games</h1>
            <ul>
                {eventList}
            </ul>
        </div>
    )
}

export default EventsContainer;
